import './App.css';

function App() {
  return (
    <Router>

  <Route path="/" component={Home}  />
  <Route  exact path="Employee/login" component={EmployeeLoginForm} />
  <Route exact path="Hr/login" component={HRLoginForm} />



</Router>
  );
}

export default App;
